// import './index.css'
import {
    ThemeProvider,
    Editable,
    EditablePreview,
    EditableInput,
    Input,
    Button
} from "@chakra-ui/core";
function Index({ children }) {
    return (
        <div className="App">
            <ThemeProvider>
            <Input  placeholder="Basic usage" />
            <Button colorScheme="blue">按钮</Button>
        <style jsx>
            {`
            .App{
                width: 1100px;
                margin: 0 auto;
            }
            `}
        </style>
        </ThemeProvider>
        </div>
    );
}
